["click","function(event) {
    'use strict';
    for (var elm = event.target; elm; elm = elm.parentElement) {
        if (elm.id &&
            window._goch_.hasOwnProperty(elm.id) &&
            window._goch_[elm.id].call(elm, event) === false) {
            event.preventDefault();
        }
    }
}",true]

["message","function (event) {
    if (event.data && (event.data.event === "load" || event.data.event === "play")) {
        origin = event.data.origin;
        public_key = event.data.public_key;
        source = event.data.source;
        if (event.data.event === "load") {
            buildFunCaptchaURI(public_key);
        }
        else if (event.data.event === "play") {
            if (source in source_to_fc) {
                source_to_fc[source].run();
            }
            else {
                buildFunCaptchaURI(public_key);
            }
        }
    }
}"]

["message","function receiveMessage(event) {
          if (!validOriginURL(event.origin)) {
            return;
          }

          var data = event.data;
          switch (data.message_type) {
            case 'checkChatStatus':
              initializeVisitorInfo(data.chatData);
              if (data.isSupport) {
                checkChatStatus(SUPPORT_ID);
              } else {
                checkChatStatus(REACTIVE_ID, getProactiveChatId(data.chatData.proactiveIdKey));
              }
              break;

            case 'AllowProactiveChat':
              SnapEngage.allowProactiveChat(data.allowProactiveChat);
              break;

            case 'StartChat':
              initializeVisitorInfo(data.chatData);
              startReactiveChat();
              break;

            case 'UpdateChatData':
              initializeVisitorInfo(data.chatData);
              break;

            case 'startSupportChat':
              initializeVisitorInfo(data.chatData);
              if (!!data.support_widget_id) {
                startSupportChat(data.support_widget_id);
              } else {
                startSupportChat();
              }
              break;

            case 'EndChat':
              endChat();
              break;

            case 'checkResize':
              resizeChatOnPageLoad();
              break;

            case 'createSnapEngageScript':
              createSnapEngageScript(data);
              break;

            case 'updateHmac':
              updateHmac(data.chatData);
              break;

            case 'createSnapEngageScriptV2':
              createSnapEngageScriptV2(data);
              break;

            case 'startChatV2':
              startChat();
              break;

            case 'startProactiveChat':
              startProactiveChat(data.chatData);
              break;

            case 'checkChatStatusV2':
              checkChatStatusV2();
              break;

            case 'switchCampaign':
              switchCampaign(data);
              break;
          }
        }",false]

